- input: "TEXT\x1CC00221077\x1C.TEXT\x1C\x1CF3XA\x1CThis amended report has been filed
    in response to FEC letter dated 4/1/09 regarding the beginning cash balance on
    the October Quarterly Report (9/15/08-9/30/08), which balance has been corrected
    on this, and subsequent, FEC reports. The original cash balance and transaction
    errors were traced back to 1/1/08, which errors prevented the reporting of correct
    cash balances and transactions on subsequent reports affected by these errors
    after a new preparer was hired in August 2008 and a new, but incomplete database,
    was created. Report shells for some 2008 reports were created at the request of
    the FEC analyst to reconcile the cash balances, but some early 2008 transaction
    history is still missing from the new database. However, the cash balances and
    transactions in the October Quarterly and subsequent reports amended this date
    are now correct and accurate to the best of our knowledge. --J. Burland, preparer.\n"
